{
  "openapi": "3.0.1",
  "info": {
    "title": "Item Management",
    "description": "The Item Management APIs enable you to set up and manage items on Walmart.com. Once you have completed Registration and have access to your Consumer ID and Private Key, you can get started with the integration process"
  },
  "servers": [
    {
      "url": "https://marketplace.walmartapis.com",
      "description": "Production URL"
    },
    {
      "url": "https://sandbox.walmartapis.com",
      "description": "Sandbox URL"
    }
  ],
  "security": [
    {
      "basicScheme": []
    }
  ],
  "paths": {
    "/v3/items/{SKU}": {
      "delete": {
        "tags": [
          "Items"
        ],
        "summary": "Retire an item",
        "description": "Completely deactivates and un-publishes an item from the site.",
        "operationId": "retireAnItem",
        "parameters": [
          {
            "name": "SKU",
            "in": "path",
            "description": "An arbitrary alphanumeric unique ID, specified by the seller, which identifies each item. This will be used by the seller in the XSD file to refer to each item. Special characters in the sku needing encoding are: ':', '/', '?', '#', '[', ']', '@', '!', '$', '&', \"'\", '(', ')', '*', '+', ',', ';', '=', as well as '%' itself. Other characters don't need to be encoded.",
            "required": true,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "required": [
                    "sku"
                  ],
                  "type": "object",
                  "properties": {
                    "sku": {
                      "type": "string",
                      "description": "An arbitrary alphanumeric unique ID, specified by the seller, which identifies each item."
                    },
                    "message": {
                      "type": "string",
                      "description": "Message confirming the deletion or retirement of an item from the Walmart Catalog"
                    }
                  },
                  "xml": {
                    "name": "ItemRetireResponse"
                  }
                },
                "example": {
                  "sku": "97964_KFTest",
                  "message": "Thank you.  Your item has been submitted for retirement from Walmart Catalog.  Please note that it can take up to 48 hours for items to be retired from our catalog.",
                  "additionalAttributes": null,
                  "errors": null
                }
              },
              "application/xml": {
                "schema": {
                  "required": [
                    "sku"
                  ],
                  "type": "object",
                  "properties": {
                    "sku": {
                      "type": "string",
                      "description": "An arbitrary alphanumeric unique ID, specified by the seller, which identifies each item."
                    },
                    "message": {
                      "type": "string",
                      "description": "Message confirming the deletion or retirement of an item from the Walmart Catalog"
                    }
                  },
                  "xml": {
                    "name": "ItemRetireResponse"
                  }
                },
                "example": "<?xml version=\"1.0\" encoding=\"UTF-8\" standalone=\"yes\"?>\n<ns2:ItemRetireResponse xmlns:ns2=\"http://walmart.com/\">\n    <ns2:sku>97964_KFTest</ns2:sku>\n    <ns2:message>Thank you.  Your item has been submitted for retirement from Walmart Catalog.  Please note that it can take up to 48 hours for items to be retired from our catalog.</ns2:message>\n</ns2:ItemRetireResponse>"
              }
            }
          }
        }
      }
    },
    "/v3/items/walmart/search": {
      "get": {
        "tags": [
          "Items"
        ],
        "summary": "Item Search",
        "description": "The Item Search API allows you to query the Walmart.com global product catalog by item keyword, UPC or GTIN. You can review all item information provided in the response, so you can decide whether or not you want to sell this item.\n\nYou must specify at least one query parameter, either: 'query', 'gtin', or 'upc'. If there are more than one item in the catalog, the search returns the first 20 items in the response.\n\nAdditionally, you can use the information provided in the 'relatedQueries' response parameter to run a new search for similar items.",
