          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "type": "object",
                  "properties": {
                    "relatedQueries": {
                      "type": "array",
                      "description": "Suggested queries to narrow down search results.",
                      "items": {
