                          },
                          "title": {
                            "type": "string",
                            "description": "Provides the seller-specified alphanumeric string that uniquely identifies the product name. Example: 'Sterling Silver Blue Diamond Heart Pendant with 18in Chain'."
                          },
                          "brand": {
                            "type": "string",
